		'έ': 'Ε',
		'ή': 'Η',
		'ί': 'Ι',
		'ΰ': 'Υ',
		'ϊ': 'Ι',
		'ϋ': 'Υ',
		'ό': 'Ο',
		'ύ': 'Υ',
		'ώ': 'Ω',
		'Ӏ': 'Ӏ',		// Russian and slavic languages
		'ӏ': 'Ӏ'
